import { Component, OnInit } from '@angular/core';
import { GoogleMapsLoader } from 'google-maps-js-api-loader';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  async ngOnInit() {
    var loader=GoogleMapsLoader({
      key:"https://maps.googleapis.com/maps/api/js?key=AIzaSyAeqThAPBANYOIgu-7Rfw7rtvXCJk2ER4c&libraries=places$callback=initMap"
    });
    await loader.load
  }
  title = 'google-maps-rnd';
  
}
